import Papa from 'papaparse';
import { useEffect, useState } from 'react';
import { Bar } from 'react-chartjs-2';
import { saveAs } from 'file-saver';

function Home() {
  const [chartData, setChartData] = useState({
    datasets: []
  });
  const [chartOptions, setChartOptions] = useState({});
  const [labelCountData, setLabelCountData] = useState([]);
  const [clickedLabelIndex, setClickedLabelIndex] = useState(null);
  const [showDoubleBarGraph, setShowDoubleBarGraph] = useState(true);
  const [dataCSV, setDataCSV] = useState([]);
  const [filteredDataCSV, setFilteredDataCSV] = useState([]);

  useEffect(() => {
    Papa.parse('/static/data.csv', {
      download: true,
      header: true,
      dynamicTyping: true,
      delimiter: "",
      complete: (result) => {
        const labelCounts = {};

        result.data.forEach((item) => {
          const label = item['req1Product'];

          if (label) {
            if (labelCounts[label]) {
              labelCounts[label] += 1;
            } else {
              labelCounts[label] = 1;
            }
          }
        });

        setChartData({
          labels: Object.keys(labelCounts),
          datasets: [
            {
              label: "Count",
              data: Object.values(labelCounts),
              borderColor: "white",
              backgroundColor: "#defde0"
            }
          ]
        });

        setChartOptions({
          responsive: true,
          plugins: {
            legend: {
              position: 'top'
            },
            title: {
              display: true,
              text: "Count of req1Product Values",
              color: 'white'
            }
          },
          scales: {
            x: {
              ticks: {
                color: 'white'
              }
            },
            y: {
              beginAtZero: true,
              title: {
                display: true,
                text: "Count",
                color: 'white'
              },
              ticks: {
                color: 'white'
              }
            }
          }
        });
        setDataCSV(result.data);
        setFilteredDataCSV(result.data);

      }
    });
  }, []);

  const handleColumnClick = async (event, activeElements) => {
    if (activeElements.length > 0) {
      const labelIndex = activeElements[0].index;
      setClickedLabelIndex(labelIndex); // Update clicked label index

      const clickedLabel = chartData.labels[labelIndex];
      const filteredData = dataCSV.filter((item) => item['req1Product'] === clickedLabel);
      setFilteredDataCSV(filteredData);

      if (showDoubleBarGraph) {
        // Create a new chart for the label count from the 'prediction' column
        const predictionLabelCounts = {};
        await new Promise((resolve, reject) => {
          Papa.parse('/static/data.csv', {
            download: true,
            header: true,
            dynamicTyping: true,
            delimiter: "",
            complete: (result) => {
              result.data.forEach((item) => {
                const prediction = item['prediction'];
                const label = item['req1Product'];

                if (label === clickedLabel && prediction !== undefined) {
                  if (predictionLabelCounts[prediction]) {
                    predictionLabelCounts[prediction] += 1;
                  } else {
                    predictionLabelCounts[prediction] = 1;
                  }
                }
              });

              const labelCountChartData = {
                labels: Object.keys(predictionLabelCounts),
                datasets: [
                  {
                    label: "Count",
                    data: Object.values(predictionLabelCounts),
                    borderColor: "white",
                    backgroundColor: ["#ff4040", "#B6E4EB"]
                  }
                ]
              };

              const labelCountChartOptions = {
                responsive: true,
                plugins: {
                  legend: {
                    position: 'top'
                  },
                  title: {
                    display: true,
                    text: `Label Count for ${clickedLabel}`,
                    color: 'white'
                  }
                },
                scales: {
                  x: {
                    ticks: {
                      color: 'white'
                    }
                  },
                  y: {
                    beginAtZero: true,
                    title: {
                      display: true,
                      text: "Count",
                      color: 'white'
                    },
                    ticks: {
                      color: 'white'
                    }
                  }
                }
              };

              setLabelCountData((prevData) => {
                const newData = [...prevData];
                newData[labelIndex] = {
                  chartData: labelCountChartData,
                  chartOptions: labelCountChartOptions
                };
                return newData;
              });

              resolve();
            },
            error: (error) => {
              reject(error);
            }
          });
        });
      } else {
        // Create a new chart for the count of each value of req2Product in the clicked column
        const req2ProductCounts = {};
        await new Promise((resolve, reject) => {
          Papa.parse('/static/data.csv', {
            download: true,
            header: true,
            dynamicTyping: true,
            delimiter: "",
            complete: (result) => {
              result.data.forEach((item) => {
                const req2Product = item['req2Product'];
                const label = item['req1Product'];

                if (label === clickedLabel && req2Product) {
                  if (req2ProductCounts[req2Product]) {
                    req2ProductCounts[req2Product] += 1;
                  } else {
                    req2ProductCounts[req2Product] = 1;
                  }
                }
              });

              const req2ProductChartData = {
                labels: Object.keys(req2ProductCounts),
                datasets: [
                  {
                    label: "Count",
                    data: Object.values(req2ProductCounts),
                    borderColor: "white",
                    backgroundColor: ["#ff4040", "#B6E4EB", "#ffc500"]
                  }
                ]
              };

              const req2ProductChartOptions = {
                responsive: true,
                plugins: {
                  legend: {
                    position: 'top'
                  },
                  title: {
                    display: true,
                    text: `Req2Product Count for ${clickedLabel}`,
                    color: 'white'
                  }
                },
                scales: {
                  x: {
                    ticks: {
                      color: 'white'
                    }
                  },
                  y: {
                    beginAtZero: true,
                    title: {
                      display: true,
                      text: "Count",
                      color: 'white'
                    },
                    ticks: {
                      color: 'white'
                    }
                  }
                }
              };

              setLabelCountData((prevData) => {
                const newData = [...prevData];
                newData[labelIndex] = {
                  chartData: req2ProductChartData,
                  chartOptions: req2ProductChartOptions
                };
                return newData;
              });

              resolve();
            },
            error: (error) => {
              reject(error);
            }
          });
        });
      }
    }
  };

  const handleCountButtonClick = () => {
    setShowDoubleBarGraph(!showDoubleBarGraph);
  };

  const handleTrimButtonClick = () => {
    const csv = Papa.unparse(filteredDataCSV);
    const csvData = new Blob([csv], { type: 'text/csv' });
    const csvURL = window.URL.createObjectURL(csvData);
    const tempLink = document.createElement('a');
    tempLink.href = csvURL;
    tempLink.setAttribute('download', 'filtered_data.csv');
    tempLink.click();
  };


  return (
    <div>
      <h4>Analysis</h4>
      <div className="import-boxes"></div>
      {chartData ? (
        <div className="graph-container">
          <div>
            <Bar options={{ onClick: handleColumnClick, ...chartOptions }} data={chartData} />
            <button onClick={handleCountButtonClick}>
              {showDoubleBarGraph ? "Interdependency among other products" : "Individual Feature Count"}
            </button>
            {clickedLabelIndex !== null && (
              <button onClick={handleTrimButtonClick}>Trim</button>
            )}
          </div>
          <div>
            {labelCountData.length > 0 && labelCountData[clickedLabelIndex] && (
              <div>
                <h4>
                  {showDoubleBarGraph
                    ? `Label Count for ${chartData.labels[clickedLabelIndex]}`
                    : `Req2Product Count for ${chartData.labels[clickedLabelIndex]}`}
                </h4>
                <Bar
                  options={labelCountData[clickedLabelIndex].chartOptions}
                  data={labelCountData[clickedLabelIndex].chartData}
                />
              </div>
            )}
          </div>
        </div>
      ) : (
        <div>Loading...</div>
      )}
      <style>{`
        .graph-container {
          width: 600px;
          height: 400px;
          margin: 0 auto;
        }
      `}</style>
    </div>
  );
}

export default Home;
